import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { getHistory, getArticlesReadThisWeek, getSearchesThisWeek } from '../services/historyService';
import './HistoryPage.css';

interface GroupedHistory {
  [key: string]: any[];
}

const HistoryPage: React.FC = () => {
  const [groupedHistory, setGroupedHistory] = useState<GroupedHistory>({});
  const [weeklyArticles, setWeeklyArticles] = useState<number>(0);
  const [weeklySearches, setWeeklySearches] = useState<number>(0);
  const navigate = useNavigate();

  useEffect(() => {
    const history = getHistory();
    const articleCount = getArticlesReadThisWeek();
    const searchCount = getSearchesThisWeek();
    setWeeklyArticles(articleCount);
    setWeeklySearches(searchCount);

    const grouped = history.reduce((acc: GroupedHistory, item) => {
      const date = new Date(item.timestamp);
      const key = date.toLocaleDateString(undefined, {
        month: 'long',
        day: 'numeric',
        year: 'numeric'
      });

      if (!acc[key]) {
        acc[key] = [];
      }
      acc[key].push(item);
      return acc;
    }, {});

    setGroupedHistory(grouped);
  }, []);

  const handleArticleClick = (title: string) => {
    navigate(`/article/${encodeURIComponent(title)}`);
  };

  const formatTime = (timestamp: number) => {
    return new Date(timestamp).toLocaleTimeString(undefined, {
      hour: 'numeric',
      minute: 'numeric'
    });
  };

  const isToday = (dateString: string) => {
    const today = new Date().toLocaleDateString(undefined, {
      month: 'long',
      day: 'numeric',
      year: 'numeric'
    });
    return dateString === today;
  };

  const isYesterday = (dateString: string) => {
    const yesterday = new Date(Date.now() - 86400000).toLocaleDateString(undefined, {
      month: 'long',
      day: 'numeric',
      year: 'numeric'
    });
    return dateString === yesterday;
  };

  const formatDate = (dateString: string) => {
    if (isToday(dateString)) return 'Today';
    if (isYesterday(dateString)) return 'Yesterday';
    return dateString;
  };

  if (Object.keys(groupedHistory).length === 0) {
    return (
      <div className="history-page">
        <div className="history-header">
          <h1 className="history-title">Activity</h1>
          <div className="history-stats">
            <p>0 articles read this week</p>
            <p>0 searches made this week</p>
          </div>
        </div>
        <div className="history-empty">
          <h2>No Activity</h2>
          <p>Articles you view will appear here</p>
        </div>
      </div>
    );
  }

  return (
    <div className="history-page">
      <div className="history-header">
        <h1 className="history-title">Activity</h1>
        <div className="history-stats">
          <p>{weeklyArticles} article{weeklyArticles !== 1 ? 's' : ''} read this week</p>
          <p>{weeklySearches} search{weeklySearches !== 1 ? 'es' : ''} made this week</p>
        </div>
      </div>
      <div className="history-list">
        {Object.entries(groupedHistory).map(([date, items]) => (
          <div key={date} className="history-group">
            <h2 className="history-date-header">{formatDate(date)}</h2>
            {items.map((item) => (
              <div
                key={`${item.title}-${item.timestamp}`}
                className="history-item"
                onClick={() => handleArticleClick(item.title)}
              >
                <div className="history-item-content">
                  <h3>{decodeURIComponent(item.title)}</h3>
                  <p className="history-snippet">{item.snippet}</p>
                  <span className="history-date">{formatTime(item.timestamp)}</span>
                </div>
                {item.thumbnail && (
                  <div className="history-thumbnail">
                    <img
                      src={item.thumbnail.url}
                      alt={item.thumbnail.description || item.title}
                      loading="lazy"
                    />
                  </div>
                )}
              </div>
            ))}
          </div>
        ))}
      </div>
    </div>
  );
};

export default HistoryPage;
